import loginPage from '../pages/login.po';
import keyPairsPage from '../pages/keyPair.po';
import keyPairShowPage from '../pages/keyPairShow.po';
import keyPairEditPage from '../pages/keyPairEdit.po'
var assert = require('assert');
let link = 'null';
let keyPairId = 'null';
let message = '#flashnotice-body';
let isDisplayed;

describe("Create, edit, delete the key pair", function() {
    it('Login', () => {
        loginPage.login();
        $('#flashnotice-body')
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.equal(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Create a key pair', () => {
        keyPairsPage.goToKeyPairPage();
        keyPairsPage.clickNew();
        keyPairsPage.provideKeyPairName();
        keyPairsPage.provideKeyPairPublicKey();
        keyPairsPage.clickSave();
        $('.show_header')
        let keyPairHeaderText = $('.show_header').getText()
        assert.equal(`${keyPairHeaderText}`, 'WDIO auto key pair')
    })
    it('Get the key pair id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          keyPairId = link.split('/').pop();
          console.log(keyPairId);
    })
    it('Edit the key pair', () => {
        keyPairShowPage.clickActions();
        let editButton = `a[href="/key_pairs/${keyPairId}/edit"]`
        $(editButton).click()
        keyPairEditPage.provideUpdatedKeyPairName();
        keyPairEditPage.provideUpdatedKeyPairPublicKey();
        keyPairEditPage.clickSave();
        $('.show_header')
        let keyPairHeaderText = $('.show_header').getText()
        assert.equal(`${keyPairHeaderText}`, 'WDIO edited auto key pair')
    })
    it('Delete the key pair', () => {
        keyPairShowPage.clickActions();
        let deleteButton = `a[href="/key_pairs/${keyPairId}"][data-method="delete"]`
        $(deleteButton).click();
        browser.acceptAlert();
        isDisplayed = $(`a[href="/key_pairs/${keyPairId}"]`).isDisplayed()
        console.log(isDisplayed)
        assert.equal(`${isDisplayed}`, 'false')
    })
})

