import loginPO from '../pages/login.page';
import keyPairPO from '../pages/keyPair.page';
import keyPairShowPO from '../pages/keyPairShow.page';
import keyPairEditPO from '../pages/keyPairEdit.page'
var assert = require('assert');
let link = 'null';
let keyPairId = 'null';
let message = '#flashnotice-body';

describe("Create, edit, delete the key pair", function() {
    it('Login', () => {
        loginPO.open();
        loginPO.providecredentials();
        loginPO.clickLogin();
        $('#flashnotice-body')
        let text = $('#flashnotice-body').getText()
        assert.equal(`${text}`, 'Signed in successfully.')
    })
    it('Create a key pair', () => {
        keyPairPO.goToKeyPairPage();
        keyPairPO.clickNew();
        keyPairPO.provideKeyPairName();
        keyPairPO.provideKeyPairPublicKey();
        keyPairPO.clickSave();
        $('.show_header')
        let keyPairHeaderText = $('.show_header').getText()
        assert.equal(`${keyPairHeaderText}`, 'WDIO auto key pair')
    })
    it('Get the key pair id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          keyPairId = link.split('/').pop();
          console.log(keyPairId);
    })
    it('Edit the key pair', () => {
        keyPairShowPO.clickActions();
        let editButton = `a[href="/key_pairs/${keyPairId}/edit"]`
        $(editButton).click()
        keyPairEditPO.provideUpdatedKeyPairName();
        keyPairEditPO.provideUpdatedKeyPairPublicKey();
        keyPairEditPO.clickSave();
        $('.show_header')
        let keyPairHeaderText = $('.show_header').getText()
        assert.equal(`${keyPairHeaderText}`, 'WDIO edited auto key pair')
    })
    it('Delete the key pair', () => {
        let deleteButton = `a[href="/key_pairs/${keyPairId}"][data-method="delete"]`
        $(deleteButton).click()
        client.alertAccept()
        assert.notExists();
    })
})

