import loginPO from '../pages/login.po';
import DNSPagePO from '../pages/DNS.po';
import DNSnewPO from '../pages/DNSnew.po';
import DNSshowPO from '../pages/DNSshow.po';
import DNSeditPO from '../pages/DNSedit.po';
var assert = require('assert');
var expect = require('expect')
let link;
let DNSid;
let isDisplayed;

describe('Create, edit, delete DNS', () => {
    it('Login', () => {
        loginPO.open();
        loginPO.providecredentials();
        loginPO.clickLogin();
        $('#flashnotice-body')
        expect('#flashnotice-body').toBeVisible()
        expect('#flashnotice-body').toHaveText('Signed in successfully.')
    })
    it('Create DNS', () => {
        DNSPagePO.open();
        DNSPagePO.clickNew();
        DNSnewPO.provideDNSsubdomain();
        DNSnewPO.clickSave();
        $('.show_header')
        let DNSheaderText = $('.show_header').getText()
        assert.equal(`${DNSheaderText}`, 'WDIO-autotest-DNS.cbp-routing.ch')
    })
    it('Get DNS id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          DNSid = link.split('/').pop();
          console.log(DNSid);
    }) 
    it('Edit DNS', () => {
        DNSshowPO.clickActions();
        let editButton = `a[href="/dynamic_domain_names/${DNSid}/edit"]`
        $(editButton).click()
        DNSeditPO.provideUpdatedDNSsubdomain();
        DNSeditPO.clickSave();
        let DNSheaderText = $('.show_header').getText()
        assert.equal(`${DNSheaderText}`, 'WDIO-edited-autotest-DNS.cbp-routing.ch')
    })
    it('Delete DNS', () => {
        DNSshowPO.clickActions();
        let deleteButton = `a[href="/dynamic_domain_names/${DNSid}"][data-method="delete"]`
        $(deleteButton).click()
        browser.acceptAlert();
        isDisplayed = $(`a[href="/dynamic_domain_names/${DNSid}"]`).isDisplayed()
        console.log(isDisplayed)
        assert.equal(`${isDisplayed}`, 'false')
    })
})

