import loginPage from '../pages/login.po'
import firewallRuleSetsPage from '../pages/firewallRuleSets.po';
import firewallRuleSetNewPage from '../pages/firewallRuleSetNew.po';
import firewallRuleSetShowPage from '../pages/firewallRuleSetShow.po';
import firewallRuleSetEditPage from '../pages/firewallRuleSetEdit.po';
var assert = require('assert');
let link;
let firewallRuleSetId;
let isDisplayed;

describe('Create, edit, delete firewall rule set', () => {
    it('Login', () => {
        loginPage.login();
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.equal(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Create a firewall rule set', () => {
        firewallRuleSetsPage.open();
        firewallRuleSetsPage.clickNew();
        firewallRuleSetNewPage.provideFirewallRuleSetName();
        firewallRuleSetNewPage.clickAddFirewallRule();
        firewallRuleSetNewPage.addFirewallRuleSSH();
        firewallRuleSetNewPage.clickAddFirewallRule();
        firewallRuleSetNewPage.addFirewallRuleHTTPS();
        firewallRuleSetNewPage.clickSave();
        $('.show_header')
        let firewallRuleSetHeaderText = $('.show_header').getText()
        assert.equal(`${firewallRuleSetHeaderText}`, 'WDIO auto firewall rule set')
    })
    it('Get the firewall rule set id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          firewallRuleSetId = link.split('/').pop();
          console.log(firewallRuleSetId);
    })
    it('Edit the firewall rule set', () => {
        firewallRuleSetShowPage.hoverActions();
        $(`a[href="/firewall_rule_sets/${firewallRuleSetId}/edit"]`).click();
        firewallRuleSetEditPage.provideUpdatedFirewallRuleSetName();
        firewallRuleSetEditPage.addFirewallRuleRDP();
        firewallRuleSetEditPage.clickSave();
        let firewallRuleSetHeaderText = $('.show_header').getText()
        assert.equal(`${firewallRuleSetHeaderText}`, 'WDIO edited auto firewall rule set')
    })
    it('Delete the firewall rule set', () => {
        firewallRuleSetShowPage.hoverActions();
        let deleteButton = `a[href="/firewall_rule_sets/${firewallRuleSetId}"][data-method="delete"]`
        $(deleteButton).click()
        browser.acceptAlert();
        isDisplayed = $(`a[href="/key_pairs/${firewallRuleSetId}"]`).isDisplayed()
        console.log(isDisplayed)
        assert.equal(`${isDisplayed}`, 'false')
    })
})

