import registrationPage from '../pages/registration.po';
import loginPage from '../pages/login.po';
import usersPage from '../pages/users.po';
let email;
let password;
let userId;

describe('Test successful registration', () => {
    it('Fill out and submit the registration form', () => {
        registrationPage.open();
        registrationPage.clickRegister();
        registrationPage.selectSalutation();
        registrationPage.provideUserTitle();
        registrationPage.provideUserFirstName();
        registrationPage.provideUserLastName();
        registrationPage.provideUserFunction();
        registrationPage.provideUserDepartment();
        registrationPage.provideUserPhoneNumber();
        email = `test.user.qa.j${faker.random.number(1000)}@gmail.com`
        $('#organization_user_email').setValue(`${email}`)
        password = `${faker.internet.password(8, 10)}`
        $('#organization_user_password').setValue(`${password}`)
        $('#organization_user_password_confirmation').setValue(`${password}`)
        registrationPage.provideOrganizationName();
        registrationPage.selectOrganizationRole();
        registrationPage.specifyOrganizationResponsible();
        registrationPage.provideOrganizationAddress();
        registrationPage.provideOrganizationPostalCode();
        registrationPage.provideOrganizationCity();
        registrationPage.provideOrganizationState();
        registrationPage.provideOrganizationCountry();
        registrationPage.provideOrganizationWebsite();
        registrationPage.provideMotivation();
        registrationPage.acceptTermsAndConditions();
        registrationPage.submitRegistrationForm();
    })
    it('First login as admin', () => {
        loginPage.login();
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.equal(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Get the user id', () => {
        usersPage.open();
        $('a[href^="/users/"]').click()
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          userId = link.split('/').pop();
          console.log(userId);        
    })
    it('Login as the new user', () => {
        loginPage.open();
        $('#user_email').setValue(`${email}`)
        $('#user_password').setValue(`${password}`)
        loginPage.clickLogin();
    })
})

