let data = require('../env');
import loginPage from '../pages/login.po';
import DNSPage from '../pages/DNS.po';
import DNSnewPage from '../pages/DNSnew.po';
import DNSshowPage from '../pages/DNSshow.po';
import DNSeditPage from '../pages/DNSedit.po';
var assert = require('assert');
var expect = require('expect')
let link;
let DNSid;
let isDisplayed;

describe('Create, edit, delete DNS', () => {
    it('Login', () => {
        loginPage.login();
        $('#flashnotice-body')
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.equal(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Create DNS', () => {
        DNSPage.open();
        DNSPage.clickNew();
        DNSnewPage.provideDNSsubdomain();
        DNSnewPage.clickSave();
        $('.show_header')
        let DNSheaderText = $('.show_header').getText()
        assert.equal(`${DNSheaderText}`, 'WDIO-autotest-DNS.cbp-routing.ch')
    })
    it('Get DNS id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          DNSid = link.split('/').pop();
          console.log(DNSid);
    }) 
    it('Edit DNS', () => {
        DNSshowPage.clickActions();
        let editButton = `a[href="/dynamic_domain_names/${DNSid}/edit"]`
        $(editButton).click()
        DNSeditPage.provideUpdatedDNSsubdomain();
        DNSeditPage.clickSave();
        let DNSheaderText = $('.show_header').getText()
        assert.equal(`${DNSheaderText}`, 'WDIO-edited-autotest-DNS.cbp-routing.ch')
    })
    it('Delete DNS', () => {
        DNSshowPage.clickActions();
        let deleteButton = `a[href="/dynamic_domain_names/${DNSid}"][data-method="delete"]`
        $(deleteButton).click()
        browser.acceptAlert();
        isDisplayed = $(`a[href="/dynamic_domain_names/${DNSid}"]`).isDisplayed()
        console.log(isDisplayed)
        assert.equal(`${isDisplayed}`, 'false')
    })
})

