import { browser } from 'protractor'
import Page from './base.po'

class LoginPO extends Page {
    providecredentials() {
        $('#user_email').setValue('yuliiadratch@gmail.com')
        $('#user_password').setValue('23031993Grace')
    }
    clickLogin() {
        //browser.click('input[value="Login"]')
        $('input[value="Login"]').click()
    }
    verifySuccessfulLogin() {
        $('#flashnotice-body')
        expect('#flashnotice-body').toHaveText('Signed in successfully.')
    }
    getUrl() {
        browser.getUrl()
        expect(browser).toHaveUrl(`${data.url}/home`)
    }
    getMessage() {
        $('#flashnotice-body')
    }
    login() {
        this.open();
        this.providecredentials();
        this.clickLogin();
    }
}

export default new LoginPO();

