import { browser } from "protractor"

export default class Page {
    open() {
        browser.url('/')
    }
    clickNew() {
        //browser.click('.icon.icon_new')
        $('.icon.icon_new').click()
    }
    clickActions() {
        $('.icon.icon_actions').click()
    }
    hoverActions() {
        $('.icon.icon_actions').moveTo(0,0)
    }
    logout() {
        $('a[href="/logout"]')
        browser.acceptAlert();
    }
}

