let data = require('../env');
import { keyPair } from '../env';
import loginPage from '../POs/login.po';
import keyPairsPage from '../POs/keyPairs.po';
import keyPairShowPage from '../POs/keyPairShow.po';
import keyPairEditPage from '../POs/keyPairEdit.po'
var assert = require('assert');
let link = 'null';
let keyPairId = 'null';
let message = '#flashnotice-body';
let isDisplayed;

describe("Create, edit, delete the key pair", function() {
    it('Login', () => {
        loginPage.login();
        $('#flashnotice-body')
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Create a key pair', () => {
        keyPairsPage.open();
        keyPairsPage.clickNew();
        keyPairsPage.provideKeyPairName(keyPair.name.value);
        keyPairsPage.provideKeyPairPublicKey(keyPair.publicKey.value);
        keyPairsPage.clickSave();
    })
    it('Make sure the key pair was created', () => {
        $('.show_header')
        let keyPairHeaderText = $('.show_header').getText()
        assert.strictEqual(`${keyPairHeaderText}`, `${keyPair.name.value}`)
    })
    it('Get the key pair id', () => {
        browser.getUrl()
        console.log()
          link = browser.getUrl()
          console.log(link)
          keyPairId = link.split('/').pop();
          console.log(keyPairId);
    })
    it('Edit the key pair', () => {
        keyPairShowPage.clickActions();
        let editButton = `a[href="/key_pairs/${keyPairId}/edit"]`
        $(editButton).click()
        keyPairEditPage.provideUpdatedKeyPairName(keyPair.name.updatedValue);
        keyPairEditPage.provideUpdatedKeyPairPublicKey(keyPair.publicKey.updatedValue);
        keyPairEditPage.clickSave();
    })
    it('Make sure the key pair has been updated', () => {
        $('.show_header')
        let keyPairHeaderText = $('.show_header').getText()
        assert.strictEqual(`${keyPairHeaderText}`, `${keyPair.name.updatedValue}`)
    })
    it('Delete the key pair', () => {
        keyPairShowPage.clickActions();
        let deleteButton = `a[href="/key_pairs/${keyPairId}"][data-method="delete"]`
        $(deleteButton).click();
        browser.acceptAlert();
    })
    it('Make sure the key pair has been deleted', () => {
        isDisplayed = $(`a[href="/key_pairs/${keyPairId}"]`).isDisplayed()
        console.log(isDisplayed)
        assert.strictEqual(`${isDisplayed}`, 'false')
    })
})

