var assert = require('assert');
let keyPairId;
let DNSid;
let instanceId;
let instanceStatus;

describe('Launch, edit, stop the instance', () => {
    it('Login', () => {
        loginPage.login(managerAdmin.email.value, managerAdmin.password.value);
        let successfulLoginMessage = $('#flashnotice-body').getText()
        assert.strictEqual(`${successfulLoginMessage}`, 'Signed in successfully.')
    })
    it('Create a key pair', () => {
        keyPairsPage.open();
        keyPairsPage.clickNew();
        keyPairsNewPage.provideKeyPairName(keyPair.name.value);
        keyPairsNewPage.provideKeyPairPublicKey(keyPair.publicKey.updatedValue);
